import {
  IonContent,
  IonHeader,
  IonTitle,
  IonToolbar,
  IonPage,

} from '@ionic/react';
import React from 'react';
import {Link} from 'react-router-dom';

const SettingsPage: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Settings</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent className="ion-padding">
        Go to <Link to="/home">Home</Link>
      </IonContent>
      </IonPage>
  );
};

export default SettingsPage;
